PREFIX dbr:Black_Sparrow_Books: <http://dbpedia.org/resource/Black_Sparrow_Books> 
PREFIX text: <http://jena.apache.org/text#> 
PREFIX dbo: <http://dbpedia.org/ontology/> SELECT DISTINCT ?proj WHERE { ?uri text:"laureate of American lowlife" . ?proj dbo:author ?uri . ?proj dbo:publisher dbr:Black_Sparrow_Books . }

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT DISTINCT ?uri 
WHERE {
        ?uri dbo:architect res:Shreve,_Lamb_&_Harmon .
      { ?uri dbo:architecturalStyle res:Art_Deco . }
      UNION
      { ?uri text:"style text:"art deco" . } 
}

PREFIX dbr:Bill_Murray: <http://dbpedia.org/resource/Bill_Murray> 
PREFIX text: <http://jena.apache.org/text#> 
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> PREFIX dbo: <http://dbpedia.org/ontology/> SELECT DISTINCT ?uri WHERE { ?uri text:"second carrier" . ?uri rdf:type dbo:Film . ?uri dbo:starring dbr:Bill_Murray . }

PREFIX text: <http://jena.apache.org/text#> 
PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT DISTINCT ?uri 
WHERE {
        text:"Father of Singapore" dbo:birthPlace ?uri .
}

